using Amazon;
using Amazon.BedrockRuntime;
using Rockhead.Extensions.Anthropic;
using System.Text.Json;
using System.Text.Json.Serialization;

namespace Rockhead.Extensions.Tests.Anthropic;

public class ClaudeTest
{
    private static readonly AmazonBedrockRuntimeClient BedrockRuntime = new(RegionEndpoint.USEast1);
    public static TheoryData<Model.Claude> LegacyModels =>
        new TheoryData<Model.Claude>
        {
            new Model.ClaudeInstantV1(),
            new Model.ClaudeV2(),
            new Model.ClaudeV2_1()
        };

    public static TheoryData<Model.Claude> Models =>
        new TheoryData<Model.Claude>
        {
            new Model.ClaudeInstantV1(),
            new Model.ClaudeV2(),
            new Model.ClaudeV2_1(),
            new Model.Claude3Sonnet()
        };

    public static TheoryData<Model.Claude> ImageSupportModels =>
    new TheoryData<Model.Claude>
    {
            new Model.Claude3Sonnet(),
            new Model.Claude3Haiku()
    };

    [Theory]
    [Trait("Category", "Integration")]
    [MemberData(nameof(LegacyModels))]
    public async Task InvokeClaudeAsync_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = @"Human: Describe in one sentence what it a large language model\n\nAssistant:";

        // Act
        var response = await BedrockRuntime.InvokeClaudeAsync(model, prompt);

        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Completion);
        Assert.NotEmpty(response.Completion);
        Assert.NotNull(response.Stop);
        Assert.NotEmpty(response.Stop);
        Assert.NotNull(response.StopReason);
        Assert.NotEmpty(response.StopReason);
    }
    
    [Theory]
    [Trait("Category", "Integration")]
    [MemberData(nameof(LegacyModels))]
    public async Task InvokeClaudeAsync_ValidConfig_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = @"Human: Describe in one sentence what it a large language model\n\nAssistant:";
        var config = new ClaudeTextGenerationConfig();
        
        // Act
        var response = await BedrockRuntime.InvokeClaudeAsync(model, prompt, config);
        
        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Completion);
        Assert.NotEmpty(response.Completion);
        Assert.NotNull(response.Stop);
        Assert.NotEmpty(response.Stop);
        Assert.NotNull(response.StopReason);
        Assert.NotEmpty(response.StopReason);
    }
    
    [Theory()]
    [Trait("Category", "Integration")]
    [MemberData(nameof(LegacyModels))]
    public async Task InvokeClaudeWithResponseStreamAsync_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = @"Human: Describe in one sentence what it a large language model\n\nAssistant:";

        // Act
        await foreach (var chunk in BedrockRuntime.InvokeClaudeWithResponseStreamAsync(model, prompt))
        {
            // Assert
            Assert.NotNull(chunk);
            Assert.NotNull(chunk.Completion);
            if (chunk.Stop is not null)
            {
                Assert.Empty(chunk.Completion);
                Assert.NotEmpty(chunk.Stop);
            }
            else
            {
                Assert.NotEmpty(chunk.Completion);
            }
            if (chunk.StopReason is not null)
            {
                Assert.NotEmpty(chunk.StopReason);
            }
        }
    }
    
    [Theory()]
    [Trait("Category", "Integration")]
    [MemberData(nameof(LegacyModels))]
    public async Task InvokeClaudeWithResponseStreamAsync_ValidConfig_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = @"Human: Describe in one sentence what it a large language model\n\nAssistant:";
        var config = new ClaudeTextGenerationConfig();
        
        // Act
        await foreach (var chunk in BedrockRuntime.InvokeClaudeWithResponseStreamAsync(model, prompt, config))
        {
            // Assert
            Assert.NotNull(chunk);
            Assert.NotNull(chunk.Completion);
            if (chunk.Stop is not null)
            {
                Assert.Empty(chunk.Completion);
                Assert.NotEmpty(chunk.Stop);
            }
            else
            {
                Assert.NotEmpty(chunk.Completion);
            }
            if (chunk.StopReason is not null)
            {
                Assert.NotEmpty(chunk.StopReason);
            }
        }
    }

    [Theory]
    [Trait("Category", "Integration")]
    [MemberData(nameof(Models))]
    public async Task InvokeClaudeMessagesAsyncWithNoImageAndNoContext_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = "Describe in one sentence what it a large language model";

        // Act
        var message = new ClaudeMessage()
        {
            Role = "user",
            Content = new List<IClaudeContent>()
            {
                new ClaudeTextContent() { Text = prompt },
            }
        };

        var response = await BedrockRuntime.InvokeClaudeMessagesAsync(model, message);

        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Content);
        Assert.NotEmpty(response.Content);

    }

    [Theory]
    [Trait("Category", "Integration")]
    [MemberData(nameof(Models))]
    public async Task InvokeClaudeMessagesAsyncWithNoImageAndContext_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = "Describe in one sentence what it a large language model";

        // Act
        var message = new ClaudeMessage()
        {
            Role = "user",
            Content = new List<IClaudeContent>()
            {
                new ClaudeTextContent() { Text = prompt },
            }
        };

        var config = new ClaudeMessagesConfig()
        {
            MaxTokens = 2000,
            Messages = new List<ClaudeMessage>()
            {
                new ClaudeMessage() { Role = "user", Content = new List<IClaudeContent>() { new ClaudeTextContent() { Text = "Hello!" } } },
                new ClaudeMessage() { Role = "assistant", Content = new List<IClaudeContent>() { new ClaudeTextContent() { Text = "Hello! How can I help you?" } } }
            }
        };

        var response = await BedrockRuntime.InvokeClaudeMessagesAsync(model, message, config);

        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Content);
        Assert.NotEmpty(response.Content);

    }

    [Theory]
    [Trait("Category", "Integration")]
    [MemberData(nameof(ImageSupportModels))]
    public async Task InvokeClaudeMessagesAsyncWithImageAndNoContext_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = "Describe the provided image";

        // Act
        var message = new ClaudeMessage()
        {
            Role = "user",
            Content = new List<IClaudeContent>()
        {
            new ClaudeTextContent() { Text = prompt },
            new ClaudeImageContent() { Source = new ClaudeImageSource() { MediaType = "image/jpeg", Data = @"" } }
        }
        };

        var response = await BedrockRuntime.InvokeClaudeMessagesAsync(model, message);

        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Content);
        Assert.NotEmpty(response.Content);

    }

