    [Trait("Category", "Integration")]
    [MemberData(nameof(ImageSupportModels))]
    public async Task InvokeClaudeMessagesAsyncWithImageAndContext_ShouldNotBeNullOrEmpty(Model.Claude model)
    {
        // Arrange
        const string prompt = "Describe the image";

        // Act
        var message = new ClaudeMessage()
        {
            Role = "user",
            Content = new List<IClaudeContent>()
        {
            new ClaudeTextContent() { Text = prompt },
            new ClaudeImageContent() { Source = new ClaudeImageSource() { MediaType = "image/jpeg", Data = @"" } }
        }
        };

        var config = new ClaudeMessagesConfig()
        {
            MaxTokens = 2000,
            Messages = new List<ClaudeMessage>()
        {
            new ClaudeMessage() { Role = "user", Content = new List<IClaudeContent>() { new ClaudeTextContent() { Text = "Hello!" } } },
            new ClaudeMessage() { Role = "assistant", Content = new List<IClaudeContent>() { new ClaudeTextContent() { Text = "Hello! How can I help you?" } } }
        }
        };

        var response = await BedrockRuntime.InvokeClaudeMessagesAsync(model, message, config);

        // Assert
        Assert.NotNull(response);
        Assert.NotNull(response.Content);
        Assert.NotEmpty(response.Content);

    }
}